masks.initializationCode:
if ((length(Ac)~=1) || (length(Fc)~=1) || (length(Ph)~=1) || (length(Kc)~=1) )
    error('commblks:ContTimeVCO:InvalidMaskParams',...
          'Mask parameters must be scalar values.');
end;
pi2=2*pi;

switch trig
case 1, s='rising';
case 2, s='falling';
case 3, s='either';
end
set_param([gcb '/Trigger'],'triggertype',s);
if (latchinput == 1)
	set_param([gcb '/In'],'latchinput','on');
else
	set_param([gcb '/In'],'latchinput','off');
end

switch trig
case 1, s='rising';
case 2, s='falling';
case 3, s='either';
end
set_param([gcb '/Trigger'],'triggertype',s);
if (latchinput == 1)
	set_param([gcb '/In'],'latchinput','on');
else
	set_param([gcb '/In'],'latchinput','off');
end

switch trig
case 1, s='rising';
case 2, s='falling';
case 3, s='either';
end
set_param([gcb '/Trigger'],'triggertype',s);
if (latchinput == 1)
	set_param([gcb '/In'],'latchinput','on');
else
	set_param([gcb '/In'],'latchinput','off');
end

if ((length(Ac)~=1) || (length(Fc)~=1) || (length(Ph)~=1) || (length(Kc)~=1) )
    error('commblks:ContTimeVCO:InvalidMaskParams',...
          'Mask parameters must be scalar values.');
end;
pi2=2*pi;
